function hexFromComputedColor(rgbString) {
  const rgb = rgbString.match(/\d+/g).map(Number);
  return (
    '#' +
    rgb
      .slice(0, 3)
      .map((c) => c.toString(16).padStart(2, '0'))
      .join('')
  );
}

